  assemblies:
  - dotNetRDF
  namespace: VDS.RDF.Storage
  summary: "\nClass for connecting to any store that implements the SPARQL Graph Store HTTP Protocol for Managing Graphs.\n"
  remarks: "\n<p>\nThe <a href=\"http://www.w3.org/TR/sparql11-http-rdf-update/\">SPARQL Graph Store HTTP Protocol</a> is defined as part of SPARQL 1.1 and is currently a working draft so implementations are not guaranteed to be fully compliant with the draft and the protocol may change in the future.\n</p>\n<p>\n<strong>Note:</strong> While this connector supports the update of a Graph the Graph Store HTTP Protocol only allows for the addition of data to an existing Graph and not the removal of data, therefore any calls to <xref href=\"VDS.RDF.Storage.SparqlHttpProtocolConnector.UpdateGraph(System.Uri%2cSystem.Collections.Generic.IEnumerable%7bVDS.RDF.Triple%7d%2cSystem.Collections.Generic.IEnumerable%7bVDS.RDF.Triple%7d)\" data-throw-if-not-resolved=\"false\"></xref> that would require the removal of Triple(s) will result in an error.\n</p>\n"
  example: []
  syntax:
    content: 'public class SparqlHttpProtocolConnector : BaseAsyncHttpConnector, IConfigurationSerializable, IAsyncStorageProvider, IStorageProvider, IStorageCapabilities, IDisposable'
    content.vb: >-
      Public Class SparqlHttpProtocolConnector
          Inherits BaseAsyncHttpConnector
          Implements IConfigurationSerializable, IAsyncStorageProvider, IStorageProvider, IStorageCapabilities, IDisposable
